import React from "react";
import { Route } from "react-router-dom";
import CssBaseline from "@material-ui/core/CssBaseline";
import "./App.css";
import Home from "./components/";
import Resume from "./components/Resume";

function App() {
  return (
    <>
      <CssBaseline />
      <Home />
      <Route path="/" component={Home} />
    </>
  );
}

export default App;
